import React, { Fragment } from "react";
import "../navBar.css";
import NavBarBtn from "./NavBarRouter";
import { withRouter } from "react-router-dom";
import NavBarSearch from "./NavBarSearch";
const NavBarItems = () => {
  return (
    <Fragment>
      <NavBarSearch />
      <NavBarBtn />
      {this.props.children}
    </Fragment>
  );
};
export default NavBarItems;
